import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import api from "../../axiosConfig";
import "./AdminDashboard.css";
import { Link } from "react-router-dom";

const AdminDashboard = () => {
  const navigate = useNavigate();
  const [adminName, setAdminName] = useState("");
  const [reports, setReports] = useState({
    totalFeedbacks: 0,
    pending: 0,
    approved: 0,
    users: 0,
  });
  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/UserLogin");
      return;
    }

    try {
      const payload = JSON.parse(atob(token.split(".")[1]));
      setAdminName(
        payload["http://schemas.microsoft.com/ws/2008/06/identity/claims/name"]
      );
    } catch (err) {
      console.error("Failed to parse token:", err);
    }

    fetchReports();
  }, []);

  const fetchReports = async () => {
    try {
      const fbRes = await api.get("Feedback/all-feedbacks");
      const feedbacks = fbRes.data;

      const usersRes = await api.get("Feedback/GetAllUsers");
      const users = Array.isArray(usersRes.data)
        ? usersRes.data.length
        : usersRes.data.data?.length || 0;

      const totalFeedbacks = feedbacks.length;
      const pending = feedbacks.filter(
        (f) => f.status.toLowerCase() === "pending"
      ).length;
      const approved = feedbacks.filter(
        (f) => f.status.toLowerCase() === "approved"
      ).length;

      setReports({ totalFeedbacks, pending, approved, users });
    } catch (err) {
      console.error("Failed to fetch reports:", err);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/UserLogin");
  };
const user=localStorage.getItem("userName")
  return (
    <div className="dashboard-container">
      {/* NAV ONLY IN DASHBOARD */}
      <header className="dashboard-header">
        <h2>Welcome, {user?user:""}</h2>
        <nav className="dashboard-nav">
          {/* <button onClick={() => navigate("/AllUsers")}>All Users</button> */}
          <Link to="/AllUsers" className="link-nav">All Users</Link>
          <Link to="/PendingFeedbacks" className="link-nav">Approve Pending Feedbacks</Link>
          <Link to="/ApproveFeedbackById" className="link-nav">Approve by ID</Link>
          {/* <button onClick={() => navigate("/PendingFeedbacks")}>
            Approve Pending Feedbacks
          </button>
          <button onClick={() => navigate("/ApproveFeedbackById")}>
            Approve by ID
          </button> */}
        </nav>
        <button onClick={handleLogout} className="logout-btn">
          Logout
        </button>
      </header>

      <main className="dashboard-content">
        <h3 className="reports-title">Reports</h3>
        <div className="reports-grid">
          <div className="report-card">
            <h4>Total Feedbacks</h4>
            <p>{reports.totalFeedbacks}</p>
          </div>
          <div className="report-card">
            <h4>Pending Feedbacks</h4>
            <p>{reports.pending}</p>
          </div>
          <div className="report-card">
            <h4>Approved Feedbacks</h4>
            <p>{reports.approved}</p>
          </div>
          <div className="report-card">
            <h4>Total Users</h4>
            <p>{reports.users}</p>
          </div>
        </div>
      </main>
    </div>
  );
};

export default AdminDashboard;
